import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import { Route, BrowserRouter as Router, Switch, NavLink } from "react-router-dom";
import Header from './components/header';
import AddPost from './components/addPost';
import GetUsersPosts from './components/getUsersPosts';
import Notfound from './components/404';
import SinglePost from './components/SinglePost';

const routing = (
        <Router>
            <Header />
            <Switch>
                <NavLink exact path="/" activeClassName="active" component={App} />
                <NavLink path="/add" activeClassName="active" component={AddPost} />
                <NavLink path="/your-posts" activeClassName="active" component={GetUsersPosts} />
                <Route path="/post/:id" activeClassName="active" component={SinglePost} />
                <Route component={Notfound} />
            </Switch>
        </Router>
    )

ReactDOM.render(routing, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
